// Querying success or failure metric alone whether lower time frame predicts higher timeframe of the SAME starting timepoints.

select FifteenMinuteTimeFrame.TimeOfSignal, FifteenMinuteTimeFrame.HourOfDay, FifteenMinuteTimeFrame.TradeType,
FifteenMinuteTimeFrame.IsPriceTargetMet, NumPriceTargetMetFifteenMinute, NumPriceTargetMetHourly

from
    (select TimeOfSignal, HourOfDay, TradeType, IsPriceTargetMet, count(*) as NumPriceTargetMetFifteenMinute
    from (select Date(TimeOfSignal) as TimeOfSignal,
        cast(24*(julianDay(TimeOfSignal)-julianDay(strftime('%Y-%m-%d 00:00:00', TimeOfSignal))) as Integer) as HourOfDay,
        TradeType, IsPriceTargetMet
        from ChartPatternSignal
             where TimeFrame = 'FIFTEEN_MINUTES') ChartPatternSignalHourly
    group by TimeOfSignal, HourOfDay, TradeType, IsPriceTargetMet) FifteenMinuteTimeFrame,

    (select TimeOfSignal, HourOfDay, TradeType, IsPriceTargetMet, count(*) as NumPriceTargetMetHourly
    from (select Date(TimeOfSignal) as TimeOfSignal,
        cast(24*(julianDay(TimeOfSignal)-julianDay(strftime('%Y-%m-%d 00:00:00', TimeOfSignal))) as Integer) as HourOfDay,
        TradeType, IsPriceTargetMet
        from ChartPatternSignal
             where TimeFrame = 'HOUR') ChartPatternSignalHourly
    group by TimeOfSignal, HourOfDay, TradeType, IsPriceTargetMet) HourlyTimeFrame

where FifteenMinuteTimeFrame.TimeOfSignal = HourlyTimeFrame.TimeOfSignal
    and FifteenMinuteTimeFrame.HourOfDay = HourlyTimeFrame.HourOfDay
    and FifteenMinuteTimeFrame.TradeType = HourlyTimeFrame.TradeType
    and FifteenMinuteTimeFrame.IsPriceTargetMet = HourlyTimeFrame.IsPriceTargetMet;



